//function for displaying different cards
var showSlide = function(current_slide,next_slide) {

document.getElementById(current_slide).style.opacity = "0%";
document.getElementById(next_slide).style.opacity = "100%" ;

document.getElementById(current_slide).style.pointerEvents = "none";
document.getElementById(next_slide).style.pointerEvents = "all";

document.getElementById(current_slide).style.transform = "translateX(-100px) scale(1)";
document.getElementById(next_slide).style.transform = "translateX(0px) scale(1)";

};

//onload
window.onload = function(){
	
document.getElementById('logo_watermark').onclick = function(){
window.location.href = "https://nuken.xyz/diskotek";
};
	
document.querySelectorAll(".menuCard")[0].style.transform = "scale(1)";
document.querySelectorAll(".menuCard")[0].style.pointerEvents = "auto";
document.querySelectorAll(".menuCard")[0].style.opacity = "100%";
		
setTimeout(function(){


const inputs = document.querySelectorAll("div.input");

for (let i = 0; i < inputs.length; i++) {
  inputs[i].style.opacity = "0";
  setTimeout(() => {
    inputs[i].style.opacity = "1";
	inputs[i].style.transform = "translateX(0px)";
  }, i * 300); // Adjust the delay time (500ms) for the desired animation effect
}


},600);

};


